import React from 'react';
import './Hero.css';
import GrassAnimation from './GrassAnimation';

const Hero = () => {
  return (
    <section className="hero">
      <div className="hero-content">
        <h1 className="hero-name">Kai Solik</h1>
        <h2 className="hero-title">UX/UI Designer</h2>
        <button className="resume-btn">
          Resume
          <svg 
            className="arrow-icon" 
            width="16" 
            height="16" 
            viewBox="0 0 24 24" 
            fill="none" 
            stroke="currentColor" 
            strokeWidth="2" 
            strokeLinecap="round" 
            strokeLinejoin="round"
          >
            <path d="M7 17L17 7M17 7H7M17 7V17"/>
          </svg>
        </button>
      </div>
    </section>
  );
};

export default Hero;
